export const Sign_img = () => {
  return (
    <>
    <div className="right_data mt-2" style={{width:"100%"}}>
            <div className="sign_img mt-1">
              <img src="./signup_image.jpeg" style={{maxWidth:400, borderRadius:50}} alt=""/>
            </div>
          </div>
    </>
  )
}
